import './productpagestyle.css';
import Arrow from '../../img/icons-arrow-left.png';



const ProductPage = () => {
    return (
        <div className="main-product-page">
            <div className='top-product-page'>
                <img src={Arrow} alt=''/>
                <div></div>
                <div></div>
            </div>
            <div className=''></div>
            
        </div>
    )
}


export default ProductPage;
